 @Component({
  selector: 'app-school-info',
  templateUrl: './school-info.component.html',
  styleUrls: ['./school-info.component.scss']
})
export class SchoolInfoComponent implements OnInit {
   public endpoint:string = '';
   isLoadingOne = false;
   editable:boolean ;
   validateForm: FormGroup;
   options = [
    { id: '1', type: '托儿所' },
    { id: '2', type: '幼儿园' },
    { id: '3', type: '小学'},
    { id: '4', type: '初中'},
    { id: '5', type: '高中'}
  ];

  params:any = {
    schoolName:'',
    schoolType:'',
    provinceCode:'',
    provinceName:'',
    cityCode:'',
    cityName:'',
    districtCode:'',
    districtName:'',
    schoolPid :''
  }


 _options = HEROES;
 _value: any[] = null;

 _console(value) {
   if(value !=''){
     this.params.provinceName = value[0].label;
     this.params.provinceCode = value[0].value;
     this.params.cityName = value[1].label;
     this.params.cityCode = value[1].value;
     this.params.districtName = value[2].label;
     this.params.districtCode = value[2].value;
   }else {
     this.params.provinceName = "";
     this.params.provinceCode = "";
     this.params.cityName = "";
     this.params.cityCode = "";
     this.params.districtName = "";
     this.params.districtCode = "";
   }

 }

 _submitForm = () => {
     this.isLoadingOne = true;
     setTimeout(_ => {
       this.isLoadingOne = false;
     }, 5000);
    if(this.validateForm.valid){
      this.params.schoolName = this.validateForm.value.schoolName;
      this.params.schoolType = this.validateForm.value.schoolType;
      this.params.schoolPid = this.validateForm.value.schoolPid;
     if(this.params.schoolName.length>256){
       this.createMessage('error','学校名称不可超过256字');
       return;
     }else {
       //保存学校信息
      this.endpoint = "school/addSchoolInfoAndGetSchoolNo?";
      this.addSchoolInfo(this.endpoint,this.params);
     }
    }
   };

  constructor(private _message: NzMessageService,private appService:AppService,private confirmServ: NzModalService,private router:Router,private fb: FormBuilder) {}

  createMessage = (type, text) => {
    this._message.create(type,text);
  };

   addSchoolInfo(endpoint,params): void {
     this.appService.get(endpoint,params).subscribe(data => {
       var res = data.json().data;
       if(data.json().suc){
         this._message.success(data.json().msg);
       }else{
         this._message.error(data.json().msg);
       }
     });
   }

 getSchoolInfo() {
   this.appService.get("school/getSchoolInfo").subscribe(data => {
     var res = data.json().data;
     if(data.json().suc){ // 赋值初始值
       this.editable = true;
       this.validateForm = this.fb.group({
         schoolType       : [ res.schoolType,  [ Validators.required ] ],
         schoolName       : [ res.schoolName, [ Validators.required ] ],
         address          : [ [res.provinceName,res.cityName,res.districtName], [ Validators.required ] ],
         schoolPid        : [ res.schoolPid, [ Validators.required ] ]
       })

     }else{
       this.editable = false;
       this._message.error(data.json().msg);
     }
   });
 }


  ngOnInit() {
    this.validateForm = this.fb.group({
      schoolType       : [ null,  [ Validators.required ] ],
      schoolName       : [ null, [ Validators.required ] ],
      address          : [ null, [ Validators.required ] ],
      schoolPid        : [ null, [ Validators.required ] ]
    })
      let ifAppAuthToken = sessionStorage.getItem('appauthtoken');
      if(ifAppAuthToken==null){
        this._message.error("您还未授权，5秒后跳转到授权页面");
        setTimeout(_ => {
          this.router.navigate(['/home/checkPower']);
        }, 5000);
      }else {
         this.getSchoolInfo()
      }
   }

}
